::::

Only a third of the total length of river ecosystems in South Africa are in a natural/near-natural ecological condition, with two-thirds in a moderately modified or worse condition. Tributaries are almost equally heavily impacted as mainstem rivers, with 38% of tributary length in a natural/near-natural condition compared to 28% of mainstems. The extent of ecosystem modifications in the inland aquatic realm reflects the wide array of pressures that are concentrated in rivers and inland wetlands that negatively impact on ecosystems and species.

