## Approach

River ecological condition was assessed as part of the Present Ecological State (PES) and Ecological Importance and Sensitivity national project currently in process by the Department of Water and Sanitation (DWS) and the Water Research Commission of South Africa (WRC), along with appointed specialists. The process was expert driven, where rivers were reviewed at quinary catchment level according to a standardised methodology to describe the extent of ecosystem modification by assessing six indicators, namely flow modification, physico-chemical modification, in-stream habitat and habitat continuity modification, riparian/wetland zone habitat and habitat continuity modification. Information from the six indicator assessments was aggregated into a final condition score, assigning ecological condition categories ranging from natural (A) to critically modified or extremely degraded (F). The score was per quinary reach in the original dataset and was cross-walked to the river ecosystem type units for the NBA assessment. 

